import PropTypes from 'prop-types';
import { translationHelper } from '../../../../helpers';


import {
  Card,
  CardBody,
  Row,
  Col,
  Button,
  Label
} from "reactstrap"

import { AvField, AvGroup } from "availity-reactstrap-validation"


const FormConclusiones = (props) => {

  const t = translationHelper('environmental_risk');


  return (
    <Card>
      <CardBody>
        <h4 className="card-title">{ t("Conclusiones y Recomendaciones") }</h4>
        <p className="card-title-desc"></p>
        <Row className="my-3">
          <Col md="12">
            <AvGroup>
              <Label htmlFor="recomendaciones"></Label>
              <AvField className="form-control"
                name="recomendaciones"
                type="textarea"
                id="recomendaciones"
                rows="4" />
            </AvGroup>
          </Col>
        </Row>
      </CardBody>
    </Card>
  );
};


FormConclusiones.propTypes = {
};

export default FormConclusiones;
